import Head from 'next/head';

import { Jumbotron, Container, Button } from 'reactstrap';
import Menu from '../components/Menu';


function Home() {
  return (
    <>
    <Head>
      <title>Home - Luciano </title>
      <meta name="description" content="Site de ... sobre ..." />
      <meta name="author" content="Luciano Valente" />
    </Head>
    
    <Menu />

    <Jumbotron fluid className="descr-top">
      <style>
        {`.descr-top{
          background-color: #000;
          color: #fed136;
          padding-top: 150px;
          padding-bottom: 150;
          margin-bottom: 0rem !important;
        }`}
      </style>
      <Container className="text-center">
        <h1 className="display-4">Título</h1>
        <p className="lead">Subtítulo</p>
        <p>
          <a href="#" className="btn btn-outline-warning btn-lg" > Texto </a>
        </p>
      </Container>
    </Jumbotron>

    <Jumbotron fluid className="servicos">
      <style>
        {`.servicos{
          background-color: #FFF;
          padding-top: 80px;
          padding-bottom: 80px;
          margin-bottom: 0rem !important;
        }`}
      </style>
      <Container className="text-center">
        <div>
          <h2 className="display-4">Título</h2>
          <p className="lead pb-4">Subtítulo</p>
        </div>
        <div className="row">
          <div className="col-md-4">
            A
            <h2 className="mt-4 mb-4">Serviço 1</h2>
          </div>
          <div className="col-md-4">
            B
            <h2 className="mt-4 mb-4">Serviço 2</h2>
          </div>
          <div className="col-md-4">
            C
            <h2 className="mt-4 mb-4">Serviço 3</h2>
          </div>
        </div>
      </Container>
    </Jumbotron>
    
    </>
  );
}

export default Home;
